import React from "react";

function Courses() {
    return (
        <div>
            <h1>Courses Page</h1>
            <ol>
                <li>MERN Stack</li>
                <li>Artificial Intelligence</li>
                <li>Python for Data Science</li>
            </ol>
        </div>
    );
}

export default Courses;
